module Day7 where

import Data.List
import Data.Maybe

data Tree = Node String Int [Tree]
  deriving (Show, Eq)

day7_1 :: String -> String
day7_1 s = head [getTreeName (snd x) | x <- results, fst x == maximum (fst (unzip results))]
  where trees1 = processInput s
        trees = completeTrees trees1 trees1
        results = (zip (map treeSize trees) trees)

treeSize :: Tree -> Int
treeSize (Node _ _ []) = 1
treeSize (Node _ _ ts) = 1 + (sum $ map treeSize ts)

processInput :: String -> [Tree]
processInput s = map makeTree (map words (lines s))

completeTrees :: [Tree] -> [Tree] -> [Tree]
completeTrees [] trees = []
completeTrees ((Node n w []):ts) trees = case nodeTrees of Nothing   -> (Node n w []):(completeTrees ts trees)
                                                           (Just (w', ls)) -> (Node n w' (completeTrees ls trees)):(completeTrees ts trees)
  where nodeTrees = lookupTree trees n
completeTrees ((Node n w ls):ts) trees = (Node n w (completeTrees ls trees)):(completeTrees ts trees)

lookupTree :: [Tree] -> String -> Maybe (Int, [Tree])
lookupTree [] _ = Nothing
lookupTree ((Node s w ls):ts) n
  | s == n    = Just (w,ls)
  | otherwise = lookupTree ts n

makeTree :: [String] -> Tree
makeTree (ss) 
  | length ss < 3 = Node (head ss) (getWeight (ss!!1)) []
  | otherwise     = Node (head ss) (getWeight (ss!!1)) (map (\s -> Node s 0 []) (drop 3 ss))

getWeight :: String -> Int
getWeight s = read (tail (init s))

completeTrees2 = map setTreeWeights

setTreeWeights :: Tree -> Tree
setTreeWeights (Node n w ts) = Node n (w + sum (map getTreeWeight (map setTreeWeights ts))) ts

getTreeWeight :: Tree -> Int
getTreeWeight (Node _ w _) = w

getTreeName :: Tree -> String
getTreeName (Node n _ _) = n

checkTreeWeights' [] _ = 0
checkTreeWeights' ((Node _ _ []):ts) trees = checkTreeWeights' ts trees
checkTreeWeights' ((Node n w ls):ts) trees = case diff of Nothing -> checkTreeWeights' ts trees
                                                          Just d  -> (getTreeWeight (head [x | x <- ls, getTreeName x == (getTreeName (head diffNode))])) + d
  where linkedTrees = [x | x <- trees, (getTreeName x) `elem` (map (getTreeName) ls)]
        diffNode = [x | x <- linkedTrees, not ((getTreeWeight x) `elem` (delete (getTreeWeight x) (map getTreeWeight linkedTrees)))]
        diff = case diffNode of (m:_) -> Just ((getTreeWeight (head (delete m linkedTrees))) - (getTreeWeight m))
                                []    -> Nothing

day7_2 s = trees
  where trees1 = processInput s
        trees2 = completeTrees trees1 trees1
        trees3 = completeTrees2 trees2
        trees = checkTreeWeights' trees3 trees3

